import React, { useState } from "react";
import {
  Drawer,
  IconButton,
  List,
  ListItemButton,
  ListItemText,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import { Link } from "react-router-dom";

// const Pages = ["Tentang", "Tahap Pendaftaran", "Coach", "Kontak", "Sign Out"];
function Drawercomp() {
  const [openDrawer, setOpenDrawer] = useState(false);
  return (
    <React.Fragment>
      <Drawer
        anchor="right"
        open={openDrawer}
        onClose={() => setOpenDrawer(false)}
      >
        {/* <List>
          {Pages.map((page, index) => (
            <ListItemButton onClick={() => setOpenDrawer(false)} key={index}>
              <ListItemIcon>
                <ListItemText>{page}</ListItemText>
              </ListItemIcon>
            </ListItemButton>
          ))}
        </List> */}
        <List>
          <ListItemButton onClick={() => setOpenDrawer(false)}>
            <ListItemText>Tentang</ListItemText>
          </ListItemButton>
        </List>
        <List>
          <ListItemButton onClick={() => setOpenDrawer(false)}>
            <ListItemText>Tahap Pendaftaran</ListItemText>
          </ListItemButton>
        </List>
        <List>
          <ListItemButton onClick={() => setOpenDrawer(false)}>
            <ListItemText>Coach</ListItemText>
          </ListItemButton>
        </List>
        <List>
          <ListItemButton onClick={() => setOpenDrawer(false)}>
            <ListItemText>Kontak</ListItemText>
          </ListItemButton>
        </List>
        <List>
          <ListItemButton onClick={() => setOpenDrawer(false)}>
            <ListItemText>
              <Link to="/">Sign Out</Link>
            </ListItemText>
          </ListItemButton>
        </List>
      </Drawer>
      <IconButton
        sx={{ color: "black", marginLeft: "auto" }}
        onClick={() => setOpenDrawer(!openDrawer)}
      >
        <MenuIcon />
      </IconButton>
    </React.Fragment>
  );
}

export default Drawercomp;
